int TabOut[1024];

void decod(int var, int var0) {
    if((var >> var0) & 1) {
        cout << "#";
    } else {
        cout << " ";
    }
}

int main() {
    //cout << sizeof(TabIn) << endl;
    int i,j, k, temp;
    for(i=0;i<8;i++) {
        for(j=0;j<128;j++) {
            if(j < 64) {
                //cout << TabIn[j+i*1024]*128+TabIn[j+128+i*1024]*64+TabIn[j+256+i*1024]*32+TabIn[j+384+i*1024]*16+TabIn[j+512+i*1024]*8+TabIn[j+640+i*1024]*4+TabIn[j+768+i*1024]*2+TabIn[j+896+i*1024] << endl;
                TabOut[j+i*64] = TabIn[j+i*1024]+TabIn[j+128+i*1024]*2+TabIn[j+256+i*1024]*4+TabIn[j+384+i*1024]*8+TabIn[j+512+i*1024]*16+TabIn[j+640+i*1024]*32+TabIn[j+768+i*1024]*64+TabIn[j+896+i*1024]*128;
            } else {
                TabOut[j+i*64+448] = TabIn[j+i*1024]+TabIn[j+128+i*1024]*2+TabIn[j+256+i*1024]*4+TabIn[j+384+i*1024]*8+TabIn[j+512+i*1024]*16+TabIn[j+640+i*1024]*32+TabIn[j+768+i*1024]*64+TabIn[j+896+i*1024]*128;
            }
        }
    }
    //aff
    for(i=0;i<8;i++) {
        for(k=0;k<8;k++) {
            for(j=0;j<128;j++) {
                if(j < 64) {
                    decod(TabOut[i*64+j], k);
                } else {
                    decod(TabOut[i*64+j+448], k);
                }
            }
            cout << "F" << endl;
        }
    }
    //inv
    for(i=0;i<512;i++) {
        temp = TabOut[1023-i];
        int temp0 = 0, temp1 = 0;
        for(k=0;k<8;k++) {
            if((TabOut[i] >> k) & 1) {
                temp0 += (1<<(7-k));
            }
            if((temp >> k) & 1) {
                temp1 += (1<<(7-k));
            }
        }
        TabOut[1023-i] = temp0;
        TabOut[i] = temp1;
    }
    //getchar();
    //system("cls");
    for(i=0;i<1024;i++) {
        cout << TabOut[i];
        if(i != 1023) {
            cout << ",";
        }
    }
    cout << endl;
    return 0;
}
